// Dependencies
import React, { useEffect } from 'react'
import { useDispatch } from 'react-redux'

// Externals
import { fetchPhones } from 'actions'

const Phones = () => {
  const dispatch = useDispatch()

  useEffect(() => {
    dispatch(fetchPhones())
  }, [])


  return (
    <div>Phones</div>
  )
}


export default Phones